import React from 'react';
import FruitCard from '../../shared/FruitCard';
import fruitData from '../../assets/data/fruits';
import { Col } from 'reactstrap';

import useFetch from '../../hooks/useFetch';
import { BASE_URL } from '../../untils/config';


const FeaturedFruitList = () => {
   const {data: featuredFruits} = useFetch('')



  return (
    <>
      {fruitData?.map((fruit) => (
        <Col lg="3" className="mb-4" key={fruit.id}>
          <FruitCard tour={fruit} />
        </Col>
      ))}
    </>
  );
};

export default FeaturedFruitList;
